import React from "react";
import UserList from "../components/UsersList";

const Users = () => {
    const Users = [
        {
            id: 'u1', 
            name: 'xxx', 
            image: 'https://images.app.goo.gl/uwVAZ59HiGNjZW8x8',
            places: 3
        }
    ];

    return <UserList items={Users} />;
};

export default Users;
